import React from 'react';

export default function librarysong({song}) {
    return (
        <div className="library-song">
        <img src = {song.cover}/>
        <div>
        <h3>{song.name}</h3>
        <h4>{song.artist}</h4>
        </div>
      </div>
    )
}
